const InterestTableElements = ({data}) => {
  return (
    <tr>
      <td>YEAR NUMBER {data.year}</td>
      <td>TOTAL SAVINGS END OF YEAR{data.savingsEndOfYear}</td>
      <td>INTEREST GAINED IN YEAR{data.yearlyInterest}</td>
      <td>TOTAL INTEREST GAINED{data.yearlyInterest}</td>
      <td>TOTAL INVESTED CAPITAL{data.yearlyContribution}</td>
    </tr>
  );
};

export default InterestTableElements;
